Project.Description:
K562 cells were synchronized by cell size difference based Elutriation scheme into G1, S and G2 fractions. Three biological replicates were collected on different days, and assembled into a 2D-CETSA scheme with 6 different heating temperatures (37ºC, 47ºC, 50ºC, 52ºC,54ºC and 57ºC), (Figure 1A, Methods section of the associated paper), with each set of samples heated at one temperature included in the same isobaric TMT10 set and measured at the same time on Mass Spectrometer.
The labeling order of samples in the TMT10 channels is as follows:
37C/47C samples: Biorep1_G1(126), Biorep1_S(127N), Biorep1_G2(127C), Biorep2_G1(128N), Biorep2_S(128C), Biorep2_G2(129N), Biorep3_S(129C), Biorep3_G1(130N), Biorep3_G2(130C), mixed_control(131);
50C/52C/54C/57C samples: Biorep1_G1(126), Biorep1_S(127N), Biorep1_G2(127C), Biorep2_G1(128N), Biorep2_S(128C), Biorep2_G2(129N), Biorep3_G1(129C), Biorep3_S(130N), Biorep3_G2(130C), mixed_control(131);
